    top: 0;
    left: 0.586rem;
    z-index: 11;
    overflow: hidden;
    cursor: pointer;

    &:hover {
        background-color: ${COLOR.Green};
    }
`;
const Span = styled.span`
    -webkit-user-select:none;
    -moz-user-select:none;
    -ms-user-select:none;
    user-select:none
`;
const Week = styled.div`
    width: 4.286rem;
    height: 2.4rem;
    display: inline-block;
    text-align: center;

`;

const pickHandle = [];

function CalList ({ onClick, value, color }) {

    return (
        <>
            <DayItemContainer key={value} id={`li${value}`}>
                <ItemLeftBox />
                    <ItemCircle id={`cal${value}`} key={value} onClick={onClick} color={color}>
                        <Span>{value}</Span>
                    </ItemCircle>
                <ItemRightBox />
            </DayItemContainer>
        </>
    )
}




